import React from "react";
import Link from "next/link";
import { Container } from "react-bootstrap";
//Components
import Navbar from "../components/Navbar";

const Layout: React.FC = ({ children }) => {
  return (
    <Container fluid="md">
      <Navbar />
      {children}
    </Container>
  );
};

export default Layout;
